import React from 'react'

export default function Player() {

    var songs = [
        {
          src: 'http://localhost:8000/Music/rock/AC_DC - Code Red (Official Audio).mp3',
          artist: 'Señorita',
          name: 'Shawn Mendes',
          img: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse3.mm.bing.net%2Fth%3Fid%3DOIP.OT9jsAGPLRZkcy-dKDIMHAHaEK%26pid%3DApi&f=1',
          id: '66575568423123',
        },
      ]

    return (
        <div >
            <audio controls="controls">
                <img src='https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse3.mm.bing.net%2Fth%3Fid%3DOIP.OT9jsAGPLRZkcy-dKDIMHAHaEK%26pid%3DApi&f=1'></img>
                <source src="url('/home/craniax/MusicApp/MusicApp/frontend/public/Music/rock/AC_DC - Code Red (Official Audio).mp3" type="audio/mpeg')"/>
                <source src="url('/home/craniax/MusicApp/MusicApp/frontend/public/Music/rock/AC_DC - Code Red (Official Audio).mp3" type="audio/mpeg')" />
            </audio>
    </div>
    )
}
